import { Grid } from "@material-ui/core";
import React from "react";
import "./styles.css";



export default function QuestionEditor() {

  return (
    <Grid xs={7}>
      <div id="quiz">
        <h1>Editor (TODO)</h1>

        <button id="submit-button">Question</button>

        <textarea placeholder="This is an awesome comment box" rows="20" name="comment[text]" id="comment_text" cols="40" class="ui-autocomplete-input" autocomplete="off" role="textbox" aria-autocomplete="list" aria-haspopup="true"></textarea>
        <button id="next-question-button">Answers</button>

        <div id="quiz-results">
          <p id="quiz-results-message"></p>
          <p id="quiz-results-score"></p>
        </div>

      </div>
    </Grid>
  );

}
